1 所有接口名称都是下划线连接
2 所有参数传递都是驼峰命名
3 返回参数结构固定为
{
   code: 10000,
   msg: "成功",
   data: {},
}
4 所有时间数据都以时间戳形式传递,并且时间戳是以毫秒为单位
5 涉及列表的请求参数形式固定为
{
   page: 1,
   count: 10,
}
如一个页面中有多个翻页需求,提供嵌套结构参数,例如
{
   companies: {
      page: 1,
      count: 10,
   },
   products: {
      page: 1,
      count: 10,
   }
}
列表数据返回的数据结构固定为:
{
    code: 10000,
    msg: "成功",
    data: {
        list: [],
        total: 100,
    }
}
